(14, 'Parker', '18', 'Parker#5915', 'NA', 0, 1, 0, 'Hey there! I am DJ Parker and I\'m an experienced DJ who is excited about joining the team!', '2601:647:5680:8fc0:5504:8ded:189a:efd', '05/16/2020 07:26:51 am', 3, 1),
(18, 'mystikal', '14', 'mystikal#5631', 'EU', 2, 1, 1, 'i would love to be a media producer or a social media manager as keyfm is lacking a presence on social media i think', '2a02:c7f:6a01:4900:bca8:5aa3:239:96c1', '05/16/2020 11:20:08 pm', 2, 38),
(19, 'Jessica', '19', 'Jess#9513', 'OC', 2, 1, 0, 'Hey!', '73.93.48.164', '05/17/2020 02:45:14 am', 3, 65),
(20, 'Mikayla', '16', 'mik_koz#6766', 'NA', 0, 1, 0, 'I’m a musician and also obsessed with music! I feel KeyFM would be a great place for be to expand my horizons a lot!’ ', '70.48.177.125', '05/18/2020 03:31:29 am', 2, 39),
(21, 'Thawlix', '15', 'Thawlix#3888I wo', 'EU', 0, 1, 0, 'I would like to learn how to DJ and it would be great if I could join KeyFM to learn how to DJ.', '84.68.3.56', '05/18/2020 09:39:45 am', 3, 1),
(22, 'Hunter Berlind', '18', 'Glue#2506', 'NA', 0, 1, 0, 'I have a love for music and what better way to listen to it with people than be on the radio. I don\'t have experience but I am willing to learn.', '2601:187:8200:2990:e42c:4aad:a956:7f09', '05/18/2020 03:35:20 pm', 2, 38),
(23, 'Trevor', '24', 'chums122#2904', 'NA', 2, 1, 0, 'Parker is making me apply. Pretty cool', '73.192.210.155', '05/20/2020 04:11:05 am', 2, 1),
(24, 'Guide Test', '13', 'Guide#1234', 'EU', 0, 1, 1, 'This is a test for the management guide :)', '81.96.23.217', '05/20/2020 10:00:05 pm', 3, 53),
(25, 'Dick Lee', '50', 'rleekgb@comcast.net', 'EU', 0, 1, 1, 'SUBJ: 60’s Garage Rock from California\r\n\r\nHello:\r\n\r\nMy name is Dick Lee and I am writing to be considered for a weekly 60 minute pre-recorded one hour volunteer slot at your station.  My self and my partner in crime (The Iceman) host a community radio show titled “Dick Lee and 60’s Garage Rock from California.”   It features garage rock from California during the decade of the 1960’s along with national hits of the day.  In addition, I do brief interviews with band members from the 1960’s (8 - 10 minutes). The show is high energy and receiving good responses.  When asked to describe the show it is like listening to a late 1960’s radio show with a Dick Clark and Wolfman Jack feeling. I have been on the air for over four years and currently working with over 80 stations (FM, AM, and internet radio stations). Please note that the show is free of charge and I have over 220 shows in the can. Many of the shows are themed shows: (i.e. \"The Summer of Love-1967,\" Monterey Rock Festival-1967,\" \"Woodstock,\" and \"Chuck Berry\").\r\n\r\nUp on request, I would be happy to send you a copy of the show via “Drop Box” or you access the last four shows by clicking on the following link: http://rleekgb30636.podomatic.com, or go to “Google” and type in “Dick Lee Podcast.”\r\n\r\nI am looking forward to hearing from you.\r\n\r\nRegards,\r\nDick Lee\r\nrleekgb@comcast.net\r\n1-541-683-2263\r\nThe Brymers (www.thebrymers.com)\r\nrleekgb@comcast.net\r\ndicklee@thebrymers.com\r\n', '71.237.216.57', '05/20/2020 10:32:35 pm', 3, 1),
(26, 'Big Al ', 'Over 40 ', 'awrmjr@gmail.com', 'NA', 0, 1, 1, ' WELL  I LOVE MUSIC ...SO..... what better way to show that than be a Disc Jockey ........', '173.75.46.4', '05/21/2020 01:27:49 am', 3, 1),
(27, 'Milan', '15', 'Milan#3100', 'EU', 0, 1, 0, 'Defectiveness forced me to.', '2a02:a03f:e0c9:700:2186:cfac:1b92:58e1', '05/21/2020 10:19:35 am', 3, 53),
(28, 'DJ Digital', '50', 'Allsorts1', 'EU', 0, 1, 1, 'Iam a Oldschool Dance Presenter and looking a New Station. Have over 30 years media/Boardcastin ', '92.40.170.36', '05/21/2020 12:15:54 pm', 3, 53),
(29, 'Jack', '17', 'jack\'#2020', 'EU', 0, 1, 0, 'I want to join KeyFM as I would like to join a smaller community and be involved with the growth. I have a passion for DJ\'ing and I love working in a team with other people that have similar interests to me. I\'m very motivated and active and work hard to ensure that my on-air standards are very high.', '92.239.181.187', '05/21/2020 12:32:27 pm', 2, 53),
(30, 'Ryan', '13', 'ReeRyan#3359', 'EU', 0, 1, 0, 'I would like to work here as i have worked at many other radios and have enjoyed it, i have just seen this radio just from the website it looks really good. If i worked here i will be dedicated and do as many slots as I can.', '92.0.173.125', '05/21/2020 02:46:15 pm', 2, 53),
(31, 'Reiss', '18', 'Reiss#0047', 'EU', 0, 1, 1, 'I want to bring my experience to KeyFM and all my awesome music and talent. I have over a year and a half Presenting experience in Radio DJ\'ing and I want to bring it here!!', '82.36.188.229', '05/21/2020 07:40:42 pm', 2, 53),
(32, 'Elytre', '14', 'Elytre#8065', 'EU', 0, 1, 0, 'I would like to join KeyFM as I am a passionate DJ, I have worked at stations such as UpBeat and Bounce and I love the community feel of KeyFM.', '77.111.247.13', '05/21/2020 10:03:42 pm', 3, 53),
(33, 'Bence', '20', 'växla#1484', 'NA', 0, 1, 1, 'I believe my years of both professional and hobbyist experience in radio broadcasting can be helpful with the growing of KeyFM. You guys look very promising and I\'d be happy to help with marketing and social media management on the side of presenting if desired.', '108.220.239.247', '05/22/2020 11:04:30 pm', 3, 53),
(34, 'Dick Lee', '50', 'rleekgb@comcast.net', 'OC', 0, 1, 1, 'SUBJ: 60’s Garage Rock from California\r\n\r\nHello:\r\n\r\nMy name is Dick Lee and I am writing to be considered for a weekly 60 minute pre-recorded one hour volunteer slot at your station.  My self and my partner in crime (The Iceman) host a community radio show titled “Dick Lee and 60’s Garage Rock from California.”   It features garage rock from California during the decade of the 1960’s along with national hits of the day.  In addition, I do brief interviews with band members from the 1960’s (8 - 10 minutes). The show is high energy and receiving good responses.  When asked to describe the show it is like listening to a late 1960’s radio show with a Dick Clark and Wolfman Jack feeling. I have been on the air for over four years and currently working with over 80 stations (FM, AM, and internet radio stations). Please note that the show is free of charge and I have over 220 shows in the can. Many of the shows are themed shows: (i.e. \"The Summer of Love-1967,\" Monterey Rock Festival-1967,\" \"Woodstock,\" and \"Chuck Berry\").\r\n\r\nUp on request, I would be happy to send you a copy of the show via “Drop Box” or you access the last four shows by clicking on the following link: http://rleekgb30636.podomatic.com, or go to “Google” and type in “Dick Lee Podcast.”\r\n\r\nI am looking forward to hearing from you.\r\n\r\nRegards,\r\nDick Lee\r\nrleekgb@comcast.net\r\n1-541-683-2263\r\nThe Brymers (www.thebrymers.com)\r\nrleekgb@comcast.net\r\ndicklee@thebrymers.com\r\n', '71.237.216.57', '05/23/2020 08:18:20 pm', 3, 1),
(35, 'Ben', '15', 'Defectiveness#5083', 'EU', 0, 1, 1, 'Made a mistake leaving this morning, want to get back into key and be better than i ever have before! ', '148.252.129.136', '05/23/2020 09:50:33 pm', 2, 53),
(37, 'Parker', '3', '223', 'EU', 0, 1, 1, 'Another test!', '73.93.48.164', '05/25/2020 02:47:50 am', 3, 1),
(38, 'Ben', '15', 'Defectiveness#5083', 'EU', 0, 1, 1, 'As you reading this application may know, I\'ve been in and out of key a lot. I was under the impression I was kicked from the discord the other day. I got a bit annoyed and was a bit rude to one of your members of staff. I\'d like a fresh start at Key to see if I can come back with a bang (assuming that i\'m not on dnh). I\'m sorry for previous actions and would love a second (third?) chance. x', '77.97.85.4', '05/26/2020 07:24:12 pm', 3, 65),
(39, 'Rozzicle', '14', 'Rosa#3041', 'EU', 2, 1, 1, 'Hey! Its Rozzicle! I want to apply for media or like a manger for it as it is been quite dead and I want to help out! ', '2a00:23c2:b00:3a00:15bd:70cf:b3c1:981c', '05/26/2020 07:45:55 pm', 3, 53),
(40, 'Jakob de Guzman (Proximitynow)', '14', 'Proximitynow#0001', 'OC', 0, 1, 1, 'I currently working at https://itsaqua.net/ and was shown this radio station by HexDev. I really enjoy being a radio presenter and enjoy listening to music. I currently use SAM for my encoder and I will be able to put time into this.', '122.60.164.105', '05/26/2020 08:31:52 pm', 3, 98),
(41, 'Dylan', '20', 'Dylanstone#5454', 'EU', 0, 1, 0, 'I guess I finally would like to be able to be involved in a radio that is comfortable having someone without a microphone. I know you are probably gonna automatically deny this but here\'s why you shouldn\'t. I\'ll bring something that I doubt many radios bring. Personality. I want to make the radio feel less like a radio, and more like a person, one who gives you non-stop tunes throughout the day. If you\'re not comfortable with me on my own, I\'m very happy being partnered with someone else if you\'d prefer that. Anywho, let me know how it goes <3', '2a02:c7f:7131:8900:500d:6612:8d9c:5319', '05/26/2020 08:42:43 pm', 3, 65),
(42, 'DylanP', '14', 'DylanP#9550', 'EU', 0, 1, 1, 'I work at a habbo fansite called Habbo Fun FM (HFFM) and It is the best place that I have ever been but I wish to expand my DJ skills to other sites. I have always said that online radios are toxic and this is really my last chance I am giving with them. If they doesn\'t work out I am just going to go back to habbo fansites. I am respectful and helpful within communities and I always try my best to help people. I am a person of chances like I do not like certain people in the discord but I am not scared to give chances. I am a live DJ which means that I mix and do everything you hear in person.', '82.21.12.130', '05/28/2020 01:50:34 pm', 3, 98),
(43, 'yusuf', '28', 'Yusuf#3346', 'EU', 0, 1, 0, 'I love djing i wanted to do more shows', '79.68.130.195', '05/28/2020 02:41:34 pm', 2, 98),
(44, 'Rozzicle', '14', 'Rosa#3041', 'EU', 0, 1, 1, 'Hey, I made a massive mistake. I should of never did what I did. I am so sorry. I know that KeyFM will get places and I want to be a part of it. I am asking for your forgiveness. I promise you I will never do something like that again. I was speaking to Olly and he said that I could apply again, as a TRD. But yeah, please accept give me a second chance. I am very sorry for what I did and I\'ll never do something like it again. If this gets claimed I\'ll leave Aqua. Thank you and sorry.', '2a00:23c2:b00:3a00:dd97:1484:7882:bc3d', '05/28/2020 08:19:08 pm', 2, 98),
(45, 'Zak', '14', 'Zak Trimmings#5415 ', 'EU', 0, 1, 0, 'I would like to be a presenter again and help this radio get more members. ', '2a02:c7d:bb90:9600:4101:8dcd:ccc1:9695', '05/29/2020 03:56:11 pm', 2, 98),
(46, 'G.Pardy ', '26', 'Pardo The Pardinator G.Pardy#8886', 'EU', 0, 1, 0, 'I would like to join KeyFM so i can bring my vast Radio Knowledge that i have learnt over the Years and to be part of a good selection of Radio Presenters.', '81.108.51.159', '05/29/2020 06:49:02 pm', 2, 98),
(47, 'Bluey', '14', 'TomArden / Bluey#1414', 'EU', 0, 1, 1, 'Because it’s a good radio', '2a02:c7f:7a56:1500:21d9:8ac4:9bb6:73a9', '05/30/2020 01:38:08 am', 2, 98),
(48, 'Reece', '12', 'Reece#9099', 'EU', 0, 1, 0, 'Why not, I do own a radio but I plan on closing that permanently if I do get accepted into KeyFM :)', '2001:bb6:5017:858:69e2:73d0:355a:dfc', '05/30/2020 04:34:27 am', 3, 62),
(49, 'Nik', '16', 'habichuela#8696', 'EU', 0, 1, 0, 'Because I’d like to play songs.', '90.171.79.97', '05/30/2020 07:17:16 am', 3, 101),
(50, 'David', '14', 'ItsJustDavid#4072', 'EU', 0, 1, 1, 'KeyFM Is an amazing radio, I am always tuned in and love listening to the wonderful DJ\'s throughout the day, I would love to be part of an amazing, growing team!', '2001:bb6:5017:858:69e2:73d0:355a:dfc', '05/30/2020 07:08:27 pm', 3, 38),
(51, 'JettersAFC', '14', 'JettersAFC#8931', 'EU', 0, 1, 0, 'I currently have no position at any radio and would like to join keyfm', '196.53.10.24', '05/30/2020 07:40:29 pm', 3, 53),
(52, 'Chance', '14 (15 in November)', 'Chance#6248', 'EU', 0, 1, 0, 'I want to at KeyFM because I saw it on Slur\'s twitter and I joined. But I do recognize a few people who were at Slur which makes me more confident as I am really shy and I make it difficult to make friends!\r\n\r\nAlso, it is a good community as I have been in the discord for a couple of weeks!', '5.149.255.178', '05/31/2020 05:09:22 pm', 2, 62),
(53, 'Daz', '22', 'Daz#7292', 'EU', 0, 1, 0, 'Hey Daz here! I\'d like to join the keyfm team as a Radio DJ. I have excellent communication and interpersonal skills, knowledge of musical trends, a clear speaking voice, self-confidence and a sense of humour! No past experience but I guess we all start somewhere!\r\nLets get this party going,\r\nDaz.', '86.29.64.155', '05/31/2020 08:45:28 pm', 2, 53),
(54, 'Geraint', '16', 'ScoutGUK#3118', 'NA', 0, 1, 0, 'I would like to join KeyFM because I am interested with all of this Online radio', '78.86.137.211', '05/31/2020 09:40:20 pm', 3, 62),
(55, 'Tage', '16', 'ZackTarell#0001', 'EU', 0, 1, 0, 'I want to join KeyFM to play music for everyone so that have something nice to listen to, and just in general have fun while playing on HabME! :D', '2001:464a:b52a:0:38cc:72b2:7589:eeb3', '05/31/2020 09:43:18 pm', 2, 53),
(56, 'Aimy', '23', 'Aimy Smith#8211', 'EU', 0, 1, 0, 'Just for fun', '82.37.21.203', '06/01/2020 07:43:38 pm', 3, 62),
(57, 'Chance', '14 (15 in November)', 'Chance#6248', 'EU', 2, 1, 0, 'I want to join KeyFM as a Media Producer because I love to write articles and tweet things! ', '86.171.17.75', '06/01/2020 09:33:14 pm', 2, 38),
(58, 'Rozzicle', '14', 'Rosa#3041', 'EU', 2, 1, 1, 'Hey! Media seems to not be very big and I want to help out on social media and news reports! I\'ll try to make the team bigger. I have good grammar and I\'m an experienced writer. ', '2a00:23c6:b05:d700:f4ee:d3e7:59c3:1c8b', '06/01/2020 10:08:32 pm', 2, 38),
(59, 'sd', 'sd', 'sdsd', 'EU', 2, 1, 1, 'sd', '2601:647:5680:8fc0:a0f0:c51c:8:35e7', '06/02/2020 01:50:39 am', 3, 1),
(60, 'Dylan', '26', 'Naughty Senpai#2636', 'NA', 0, 1, 0, 'Back during my Habbo golden age I used to love running a Radio as well as a sort of Night Club. However! I feel like it\'d be something that would be enjoyable and would probably give me more of a reason to keep being active!\r\n\r\nHowever, as it has been a few years I\'d probably need some info as to which programs are the ones to be using nowadays. Once I\'ve got them acquired it shouldn\'t be much issue for me to get things up and running rather quickly.', '2001:56a:7772:5600:ec3b:ccdd:cbda:83f9', '06/03/2020 12:20:53 am', 2, 101),
(62, 'Nad', '19', 'Nad#4947', 'OC', 0, 1, 0, 'To entertain HabMe users when they\'re playing and interact with them even if we\'re not in the same room', '218.186.172.92', '06/03/2020 08:28:46 am', 1, 101),
(63, 'Flex', '24', 'Flex#9410', 'EU', 0, 1, 0, 'Ive never done this but would like to try it as i love music', '92.236.19.126', '06/03/2020 12:26:20 pm', 3, 37),
(64, 'Jess', '18', 'Yzel#6969', 'EU', 0, 1, 0, 'I remember being little and trying to open my own radio show on some online radio, it was so sweet, but it didn\'t go so well, because after a day I had to pay and my radio went down!\r\n\r\nI want to bring my childhood dream back to life as an adult. \r\nAnd I love making people laugh I\'d love to share that!', '90.200.37.247', '06/03/2020 12:49:05 pm', 2, 37),
(65, 'Dan', '13', 'Danckii#6481', 'EU', 0, 1, 0, 'I want to become a dj cause i wanted to entertain people and play music to the people i like to interact with people and be this is my first time being a dj for a radio', '2a02:a18:8976:9f01:51c7:4401:b2f4:5573', '06/03/2020 06:31:58 pm', 2, 38),
(66, 'Supreme', '18', 'P4trick#7007', 'EU', 0, 1, 1, 'I want to play songs on the game I got a cool playlist :]', '46.99.107.186', '06/03/2020 06:55:14 pm', 3, 38),
(67, 'Fin', '13', 'Fin#2624', 'EU', 0, 1, 0, 'I really like this radio station', '2a02:c7f:968b:f000:49a9:7882:c5b9:59af', '06/03/2020 09:53:33 pm', 2, 38),
(68, 'Matton', '13', 'mattonroblox01#6931', 'EU', 0, 1, 0, 'Is this how you join?', '47.198.23.13', '06/04/2020 11:45:36 am', 3, 62),
(69, 'Geraint Baker', '16', 'ScoutGUK#3118', 'EU', 0, 1, 0, 'I would like to be part of KeyFM because I want to do something new', '2a02:c7f:ae25:aa00:1035:34f2:1718:9da1', '06/04/2020 02:49:33 pm', 2, 62),
(70, 'Josiah', '16.5', 'josiah#5735', 'NA', 0, 1, 1, 'I\'d love to join KeyFM because I\'d love to have a place to play my Pop set. I think KeyFM has potential, and I\'d love to get to know a bunch of the staff here. ', '24.240.53.128', '06/04/2020 02:52:23 pm', 2, 62),
(71, 'Fade_Daily', '14', 'Fade_Daily#9140', 'EU', 0, 1, 1, 'I want to join KEYFM, as I work as a new reporter not here but on another chat, I want to help out with speaking and Benefit the Company and not Troll when speaking and be nice to everyone and have calm voice.', '82.132.219.63', '06/04/2020 03:15:02 pm', 2, 62),
(72, 'Rob', '20', 'Robb#6969', 'EU', 0, 1, 0, 'Only good radio about atm', '82.46.227.179', '06/04/2020 08:19:31 pm', 2, 62),
(73, 'Tage', '16', 'ZackTarell#0001', 'EU', 2, 1, 1, 'I put yes on \"Do you currently work for a radio?\" Since i work for u guys <3 But i would like to join the media team to be able to have people updated on keyfm. Much love <3', '2001:464a:b52a:0:14da:f557:32db:438e', '06/04/2020 08:55:29 pm', 2, 38),
(74, 'Lewis', '16', 'P4tc#7103', 'EU', 0, 1, 0, 'My friend Zak works here and I have heard great things about here and would like too join your great online radio station ', '81.158.197.208', '06/08/2020 12:52:37 pm', 2, 62),
(75, 'Matt', '18', 'Mango#2888', 'EU', 0, 1, 0, 'I would love to start djing! and having fun and stuff ', '2a02:c7f:a8e6:9e00:e16f:6fbe:e13e:7fd9', '06/11/2020 03:05:59 am', 2, 62),
(76, 'sexy', '22', 'Sexy#0563', 'EU', 0, 1, 0, 'because i want to play my  music', '94.197.118.240', '06/11/2020 01:26:44 pm', 2, 62),
(77, 'Hacker', '15', 'Hacker_1080#0915', 'EU', 0, 1, 0, 'I would like to become a Radio DJ here as I would like to become a real Radio DJ when I am older. I have a good activity so I can do this for a few hours. I loved the radio for a long time and I believe that is is the best next step. I loved helping people. My friend is a DJ here and I want to be like him. Thank you for reading this. ', '77.96.193.24', '06/16/2020 12:32:24 pm', 2, 62),
(78, 'Jackie', '14', 'AsteroidGamer#6706', 'EU', 0, 1, 0, 'I would like to join KeyFM as I want to help others have a great day by giving them some amazing songs to listen to. Music can help mental and physical feelings and I would love to make their day. I would also like to gain the experience at KeyFM to climb my way up the ladder here.', '79.75.100.14', '06/16/2020 01:33:09 pm', 2, 62),
(79, 'Rhiannon', '19', 'Shantelle#7827', 'EU', 0, 1, 0, 'have a wide range of music knowledge', '112.141.172.12', '06/17/2020 06:59:37 am', 0, 0),
(80, 'Hacker', '15', 'Hacker_1080#0915', 'EU', 2, 1, 0, 'Hello. My name is Hacker_1080. I applied for being a DJ here but I did not fit me. I would like to apply for media as I want to be part of the KeyFM staff team. I love helping people and I love KeyFM. I have lots of practise with different social media platforms such as Twitter and Facebook. I think I am a good candidate as I have high activity and I am responsible and reliable. Thank you for reading this application.\r\n', '77.96.193.24', '06/18/2020 04:33:10 pm', 0, 0);
