INSERT INTO `reviews` (`id`, `user`, `admin`, `type`, `content`, `impro`, `published`, `times`) VALUES
(17, 71, 38, 3, 'You\'re doing a great job and I know it has been hard with TweetDeck just now being set up, but thank you for your overall hard work :)', 'Just be more active on discord and on Twitter.', 1, '06/12/2020'),
(18, 125, 38, 1, 'he gone gone', 'rip', 1, '06/12/2020'),
(19, 123, 38, 1, 'Guest DJ- Has not linked Discord to Panel, therefore has not had panel access. ', 'Link discord and access panel.', 1, '06/12/2020'),
(20, 43, 53, 1, 'Hey Cole, this week you have been a tiny bit more active than before. However, you have NOT actively completed **ANY** slots neither have you partaken in any conversation.', 'Complete minimums, be active in chats.', 1, '06/12/2020'),
(22, 62, 37, 4, 'Hi Zane! I\'ve broken your own rules and written your review on a Friday night, how do you feel now, huh? Anyways, not much to say really. Always doing what is needed of you, when it\'s required and without any hesitation. You are vital in the development of the radio so really glad to have you so committed at the moment. Great skills when it comes to motivating the staff and settling argument (i.e. Chance & Zak). My next goal is to stop you cat-fishing us, so you should go on air sometime and speak 😬', 'N/A - Maybe go on air more often? ', 1, '06/12/2020'),
(23, 84, 1, 1, 'Hey Berk, this week you really haven\'t done much in terms of your Head DJ job or your developer job.', 'Please step it up on the Head DJ front and message Parker to see what you can do to help with development.', 1, '06/12/2020'),
(24, 63, 62, 3, 'Hey Craig! This week you have managed to complete a total of 7 slots which is outstanding! Your slots are consecutive and consist of great music. Keep it up!', 'An improvement would be to be more active in the Discord as this week alone you posted 21 messages. Overall, you’re doing great.', 1, '06/12/2020'),
(25, 118, 62, 1, 'Hey Dan! This week we have failed to see you book any slots or be active in the Discord. If you need help being trained please, message in #training and let a Head DJ know.', 'Complete minimums by going on-air and completing 3 consecutive slots. Be active in the Discord too. We would love to see more of you.', 1, '06/12/2020'),
(26, 107, 62, 1, 'Hi Pardo! Hope you’re well, you have been excused from doing some slots this week as you a key worker and we highly appreciate and respect that.', 'Attempt to do some slots (maybe 1 or 2) and attempt to be active in the Discord. If you cannot, it is understandable @ Key worker', 1, '06/12/2020'),
(27, 126, 110, 3, 'Hi Lewis! Even though you had trouble getting set-up at the beginning of the week, you have put a lot of effort into doing 8 slots which is amazing!', 'To improve we would like to see you be more active in the discord!', 1, '06/12/2020'),
(28, 113, 110, 3, 'Hi Wade! When writing this review you have done 6 slots which is amazing! Even though I didn\'t have time to listen to one of the times as you booked NA slots I am sure you did great!', 'To improve we would like you to be a bit more active in the discord!', 1, '06/12/2020'),
(29, 119, 110, 0, 'You have been posted away this week, a review hasn\'t been written for you. But I hope your wrist gets better soon so you can do some more of your amazing slots!', '', 1, '06/12/2020'),
(30, 103, 53, 2, 'Hey Zak, you are usually really active and involved but this week you\'ve not pushed yourself! ', 'I wanna see you aiming for Head DJ! Push yourself and work harder!', 1, '06/13/2020'),
(31, 112, 53, 2, 'This week you have NOT completed minimums, you are normally up to the dot with work!', 'Complete minimum slots in future.', 1, '06/13/2020'),
(32, 72, 53, 4, 'This week you completed minimums! Well done Glue!', 'Keep going!', 1, '06/13/2020'),
(33, 53, 37, 3, 'Hi Olly! I hope you are doing well and enjoying your new boyfriend 😉 This week you have exceeded expectations again but your activity has been slightly lower than previous weeks. This is expected though due to your current circumstances. ', 'Increase that activity back to normal', 1, '06/13/2020'),
(34, 104, 37, 0, 'Hi Aaron. I hope you are doing well. You are a Guest DJ so you don\'t get a review every week but every slot I have listened to has been very good. Keep it up!', '', 1, '06/13/2020'),
(35, 106, 37, 0, 'Hi Jak. I hope you are doing well. You are a Guest DJ so you don\'t get a review every week but every slot I have listened to has been very good. Keep it up!', '', 1, '06/13/2020'),
(36, 110, 101, 3, 'Booked 5 slots (at time of writing) for this week. Which is above the minimum, active with staff and tries to get DJs booking slots. ', 'Try and be more active in public chats. ', 1, '06/13/2020'),
(37, 96, 101, 1, 'Only completed one slot this week. ', 'Would be nice if more slots are booked and completed, being a guest DJ you are not required to do this but would be nice. ', 1, '06/13/2020'),
(38, 121, 101, 1, 'We are aware of the current circumstances you are in. We respect that and understand that. Hope to hear from you soon!\r\n', 'Hope we can hear from you shortly and that you are able to do some more amazing slots for people to come and listen too. \r\n', 1, '06/13/2020'),
(39, 120, 1, 1, 'Hey G, you did not complete **ANY** slots this week and missed a slot. If you have a reason for this please message an admin to get your trial extended.', 'Complete your slot & be active in discord', 1, '06/13/2020'),
(40, 111, 1, 1, 'Hey Daz, you did not complete **ANY** slots this week.If you have a reason please contact an admin to extend your trial.', 'Complete your 3 slots and be active in discord.', 1, '06/13/2020'),
(41, 57, 1, 1, 'Hey Emil, What\'s going on bud? You completed **NO** slots this week.', 'Complete your minimums & be active in discord.', 1, '06/13/2020'),
(42, 101, 1, 4, 'FAB!!! You completed all your slots and more this week. Thank you <3', 'Not really much, maybe more active in the public channels.', 1, '06/13/2020'),
(43, 1, 1, 4, 'test', 'test', 1, '06/20/2020');
